import React from 'react';
import './All_tools.css';

const icons = [
  'rails.png',
  'JavaScript.png',
  'React.png',
  'Redux.png',
  'RESTAPI.jpeg',
  'Postgresql.png',
  'HTML.png',
  'Bootstrap.png',
  'GitHub.png',
  'Figma.png',
  'Trello.png',
  'Salesforce.jpeg',
];

function AllTools() {
  function HoverHandler() {
    // Add your hover handling logic here if needed
  }

  return (
    <div className="icons_container">
      <h2>My Tools</h2>
      {icons.map((icon, index) => (
        <img
          key={index}
          className="icon"
          onMouseOver={HoverHandler}
          src={require(`../../../images/Icons/${icon}`).default}
          alt={`${icon} icon`}
        />
      ))}
    </div>
  );
}

export default AllTools;
